import React from 'react';
import './App.css';

function App() {
  const title = "";
  return (
    <div className="root-view">
      <div className="rm-toolbar">
        <div className="logo">ICloud미리 알림</div>
        <div className="gnb">김진범</div>
      </div>
      <div className="main-view">
        <Sidebar value={title}></Sidebar>
        <RmList value={title}></RmList>
      </div>
    </div>
  );
}

class Sidebar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    const rmList = Array.of(
      <li>1</li>,
      <li>2</li>,
      <li>3</li>
    );

    return (
      <div className="sidebar">
        <ul>
          {rmList}
        </ul>
      </div>
    );
  }
}

class RmList extends React.Component {
  render() {
    return(
      <div className="rm-list">
        <div className="rm-list-header">
          <div className="inline-editable-label" role="textbox">
            Default
          </div>
        </div>
        <div className="rm-list-body"></div>
        <div className="rm-list-footer">새로운 미리 알림</div>
      </div>
    );
  }
}

export default App;
